    "2016-07-27T22:42:26.445632",nt"name": "trace-elements-and-organic-compounds-in-the-spring-river-basin-of-southeastern-kansas-in-1",nt"isopen":
    false,nt"url": null,nt"notes": "We sampled sediments and aquatic biota
    at five locations in the Spring River drainage in southeastern Kansas. The samples
    were analyzed for metals, organochlorine compounds, and aliphatic hydrocarbons.
    Concentrations of aluminum, arsenic, barium, beryllium, boron, copper, iron, magnesium,
    mercury, nickel, selenium, strontium, and vanadium in sediments and biota warrant
    no further studies. Cadmium concentrations in Empire Lake and Spring River sediments
    were very high, but the cadmium was not accumulated by biota of the lake or the
    river. However, continued monitoring of cadmium in biota of the river is warranted
    because changes in Ph or other chemical measures of the river or tributary creeks
    might affect cadmium availability. There is lead and zinc contamination at the sampling
    sites. Concentrations of chromium and manganese in one or more samples indicate
    that continued monitoring of those metals in the Spring River is warranted. Chlordane
    compound concentrations in biota from Cow Creek outside of Pittsburg indicate episodic
    chlordane contamination. Seven fish composites contained a PCB concentration higher
    than the EPA protection criterion. The highest PCB concentrations were found in
    Cow Creek and the Spring River arm of Empire Lake. The PCB concentration in the
    seven composites exceeded the 1984 NCBP mean, but were well below the maximum observed
    in the NCBP in 1984. The tota1 of aliphatic compounds in five fish composites from
    the Spring River was above the probable level for discernible effects. The aliphatic
    hydrocarbon concentrations in many of the biota samples indicated recent petroleum
    contamination.",nt"license_title": "License Not Specified",nt"extras":
